import FormGroup from '@mui/material/FormGroup';
import FormControlLabel from '@mui/material/FormControlLabel';
import Checkbox from '@mui/material/Checkbox';
import { useEffect, useState } from 'react';
import { useNavigate } from "react-router-dom";

import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemText from '@mui/material/ListItemText';
import CircleIcon from '@mui/icons-material/Circle';
import ListItemIcon from '@mui/material/ListItemIcon';
import LooksOneOutlinedIcon from '@mui/icons-material/LooksOneOutlined';

import Navbar from "./Navbar";
import '../styles/Confirm.css'

const Confirm = () => {

    const [check, setCheck] = useState([]);
    const handleChange = () => {
        setCheck(!check);
    };

    const [show, setShow] = useState(false);



    return (
        <>
            <Navbar />
            <div className="confirm-content">
                <h1>Så här går du tillväga</h1>
                <List>
                    <ListItem>
                    <ListItemIcon><LooksOneOutlinedIcon /></ListItemIcon>
                    </ListItem>
                    <ListItem>2</ListItem>
                    <ListItem>3</ListItem>
                    <ListItem>4</ListItem>
                </List>
                <FormGroup>
                    <FormControlLabel control={<Checkbox onChange={handleChange} onClick={() => setShow(!show)} />} label="Jag har läst och förstått instruktionerna" />
                </FormGroup>
                <div>
                    {
                      show && <button className='selectBTN'>OKEJ</button>
                    }
                </div>
            </div>
        </>
    );
}

export default Confirm;
